import React from "react";

const About = () => {
  return (
    <section className="about">
      <img src="" className="img"></img>
      <p className="content-2">
        Explore Authentic Roller World Stock Videos & Footage For Your Project
        Or Campaign. Less Searching, More Finding With Getty Images.
      </p>
    </section>
  );
};

export default About;
